INSERT INTO `journal_encounter_section` (`ID`, `Title`, `BodyText`, `JournalEncounterID`, `OrderIndex`, `ParentSectionID`, `FirstChildSectionID`, `NextSiblingSectionID`, `Type`, `IconCreatureDisplayInfoID`, `UiModelSceneID`, `SpellID`, `IconFileDataID`, `Flags`, `IconFlags`, `DifficultyMask`, `VerifiedBuild`) VALUES
(30861, 'Damage Dealers', '$bullet; Firestarters should be lured away from the raid. The explosion from |cFF2959D3|Hspell:464983|h[Torch]|h|r is large and inflicts high damage.\n$bullet; Flamewalkers cast |cFF2959D3|Hspell:470164|h[Magma Infusion]|h|r until they are defeated, making it more difficult to navigate the Iron Hall.\n$bullet; Players should destroy portal anchors as quickly as possible while ensuring Burning Spirits do not successfully cast |cFF2959D3|Hspell:464769|h[Fury of the Firelands]|h|r.', 2669, 3, 30859, 0, 30862, 3, 0, 0, 0, 0, 0, 2, -1, 57534),
(30900, 'Overview', 'Emperor Dagran Thaurissan and Princess Moira Bronzebeard are both formidable combatants. Moira\'s |cFF2959D3|Hspell:466504|h[Shadow Word: Nemesis]|h|r and |cFF2959D3|Hspell:470599|h[Shadow Word: Necrosis]|h|r must be managed carefully or they will overwhelm the raid. Moira will attempt to heal Dagran with |cFF2959D3|Hspell:470605|h[Radiant Infusion]|h|r. \n\nDagran is a dangerous melee combatant that will |cFF2959D3|Hspell:465077|h[Call Imperial Guard]|h|r and |cFF2959D3|Hspell:465079|h[Call Twilight\'s Hammer Ambassadors]|h|r to repel the invaders. When Moira is defeated, Dagran will transform into a powerful |cFF2959D3|Hspell:465069|h[Avatar of Flame]|h|r, empowering all his abilities.\n\nWhen he becomes desperate, Dagran willl |cFF2959D3|Hspell:466332|h[Beseech The Firelord]|h|r to save him. The Avatar of Ragnaros unleashes devastation that will slowly consume the entire room in molten fire until Dagran is defeated. Dagran will no longer call Imperial Guard or Twilight\'s Hammer Ambassadors to his side once Ragnaros joins the battle.', 2670, 1, 0, 30901, 30904, 3, 0, 0, 0, 0, 0, 0, -1, 57534),
