(30722, 'Overview', 'Lord Roccor casts |cFF2959D3|Hspell:462351|h[Roiling Magma]|h|r on his target, inflicting damage and providing the raw material to |cFF2959D3|Hspell:463674|h[Crystallize]|h|r his obsidian progeny.\n\nWhen Lord Roccor reaches 95% health and every 20% damage suffered thereafter, he will cast |cFF2959D3|Hspell:462322|h[Eruption]|h|r, filling the room with |cFF2959D3|Hspell:462351|h[Roiling Magma]|h|r. Each |cFF2959D3|Hspell:462346|h[Living Magma]|h|r that reaches its destination will increase the power of the elemental created by |cFF2959D3|Hspell:462320|h[Igneous Crystallization]|h|r.\n\nUpon reaching 100 energy, Roccor casts |cFF2959D3|Hspell:462317|h[Volcanic Upheaval]|h|r, inflicting huge damage to all players.', 2663, 1, 0, 30726, 30706, 3, 0, 0, 0, 0, 0, 0, -1, 57534),
